import React from 'react';
import { BrowserRouter, HashRouter, MemoryRouter, Route, Link } from 'react-router-dom';

const PageOne = () => {
  return(
    <div>
      PageOne
      <Link to="/pagetwo">PageTwoNavigation</Link>
    </div>
  );
}

const PageTwo = () => {
  return(
    <div>
      PageTwo
      <Link to="/">PageOneNavigation</Link>
    </div>
  );
}

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Route path="/" exact component= { PageOne } />
        <Route path="/pagetwo" exact component= { PageTwo } />
      </BrowserRouter>
    </div>
  );
}

export default App;
